description:
Cần bán nhanh căn nhà 4 tầng dân xây cực chắc chắn tại Trâu Quỳ, Gia Lâm, Hà Nội:
- Dt 60.2m2, mt và hậu 3.8m. Đã có sẵn nhà 4 tầng dân xây chắc chắn trên đất.
- Trục đường trải nhựa thông, oto thông chạy bon bon;
- Mặt kinh doanh, đông đúc sinh viên của trường Nông Nghiệp;
- Đi vài bước chân tới KĐT 31ha Trâu Quỳ, chợ Trâu Quỳ, công viên Gia Lâm, chợ sinh viên, trường Nông Nghiệp;
- Sổ hồng sẵn giao dịch;
- Giá chỉ 12 tỷ (có thương lượng khi vào việc)
LH em HUYỀN để xem 24/7
